import React, {Component} from 'react';
export default class Group extends Component {
    render(){
        return (
            <div className='border-left padding-md'>
                <div className='section-title'>Affiliated groups</div>
                <div className='text'>Human Data Interaction group</div>
                <div className='text'>Human Computer Interaction Lab</div>
                <div className='text'>Bohyemian Lab</div>
            </div>
        )
    }
}
